import React from 'react';
import {Static} from './Static';
import { testProperties } from './Static';

function App() {
  return (
    <div>
<p style={{
  fontSize: '24px',
  fontWeight: '600',
  color: '#333',
  margin: '20px 0',
  textAlign: 'center',
  fontFamily: '"Roboto", sans-serif',
  lineHeight: '1.4'
}}>
  Персональный агент по подбору недвижимости от 2GIS
</p>
      <Static properties={testProperties} />
    </div>
  );
}

export default App;
